import React from 'react';
import Smalls from '../../images/booksandbrewskies/Yourekillingmesmalls.jpg';

const CoolStuff = () => {
  const titleStyle = {
    borderBottom: "2px solid #fff",
    width: "50%",
    margin: "auto",
    padding: "10px"
  }
  return(
    <>
    <div className="cool-stuff pt-4">
      <h1 style={titleStyle}>Beers Of The Week</h1>
    <div className="row pt-5">
      <div className="col-md-6 offset-md-3">
          <div className="media">
          <img className="mr-3 round m-auto" src={Smalls} height="200px" width="200px" alt="Smalls"/>
        <div className="media-body">
          <h5 className="mt-0">Media heading</h5>
          Cras sit amet nibh libero, in gravida nulla. Nulla vel metus scelerisque ante sollicitudin. Cras purus odio, vestibulum in vulputate at, tempus viverra turpis. Fusce condimentum nunc ac nisi vulputate fringilla. Donec lacinia congue felis in faucibus.
        </div>
      </div>
      </div>
    </div>
    </div>
    </>
  )
}

export default CoolStuff;
